import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, NavDropdown, Dropdown, DropdownButton, Button } from 'react-bootstrap'
import { useNavigate } from "react-router-dom";
import './Navbar1.css';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';
import DropdownToggle from 'react-bootstrap/esm/DropdownToggle';
import DropdownMenu from 'react-bootstrap/esm/DropdownMenu';
// import logoutIcon from './logout-icon.png';
import DropdownContext from 'react-bootstrap/esm/DropdownContext';
import DropdownItem from 'react-bootstrap/esm/DropdownItem';

function Navbar1(props) {
// const renderTitle=(props)=>(
//   <div>
//     <img src={logoutIcon} alt="Logout" style={{height:'20px',marginRight:'10px'}}/>
//     <span>{props.children}</span>
//   </div>
// )
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light navbar-custom ">
        <div className="container-fluid">

          <a className="navbar-brand ">
            <b>Employee Management System</b>
          </a>
        </div>

        <NavbarCollapse id="basic-navbar-nav">
          <Nav className="ml-auto">
          </Nav>
        </NavbarCollapse>
        <Nav className="ml-auto">
          <Link to="/" ><Button style={{ backgroundColor: 'white ', color: 'black' }} className='custom-button'>Home</Button></Link>
        </Nav>

<Dropdown>
        {/* <DropdownButton title="Login" className="custom-dropdown-button"> */}
          <Dropdown.Toggle variant='info' style={{color:'black',background:'white'}}
          >Login</Dropdown.Toggle>
           <DropdownMenu style={{color:' rgb(96, 197, 228)',background:'white'}}>
          {/* <NavDropdown.Divider></NavDropdown.Divider> */}
          <Dropdown.Item style={{color:' rgb(96, 197, 228)',background:'white'}}>

            
         
          <Link  to="/Admin" className='nav-link'>Admin</Link>
            {/* <Link>
              Admin
            </Link> */}
          </Dropdown.Item>

          <Dropdown.Item style={{color:' rgb(96, 197, 228)',background:'white'}} >
            <Link to="/Manager"  className='nav-link'>
              Manager
            </Link>
          </Dropdown.Item>

          <Dropdown.Item  style={{color:' rgb(96, 197, 228)',background:'white',textDecoration:'none',textDecorationLine:'none',textDecorationStyle:'none'}}>
            <Link to="/Employee"  className='nav-link'>
              Employee
            </Link>
          </Dropdown.Item>

          {/* <NavDropdown.Divider></NavDropdown.Divider> */}
          {/* <Dropdown.Item style={{color:'black',background:'white'}}>

          </Dropdown.Item> */}
         </DropdownMenu>
        {/* </DropdownButton> */}
        </Dropdown>

        {/* <Dropdown>
          <DropdownToggle as={renderTitle}>
       Logout
          </DropdownToggle>
          <DropdownItem onClick={onLogout}>Logout</DropdownItem>
        </Dropdown> */}

      </nav>

    </div>
  );
}

export default Navbar1;
